import React, { Component } from "react";
import Tabs from "react-bootstrap/Tabs";
import Tab from "react-bootstrap/Tab";
import Education from "./education";

class Navbar extends Component {
  state = {
    tabs: [
      { id: 1, eventKey: "bio", title: "BIO", component: "" },
      {
        id: 2,
        eventKey: "education",
        title: "EDUCATION",
        component: <Education />
      },
      { id: 3, eventKey: "experience", title: "EXPERIENCE", component: "" },
      { id: 4, eventKey: "skills", title: "SKILLS", component: "" },
      { id: 5, eventKey: "software", title: "SOFTWARE", component: "" }
    ]
  };

  get styles() {
    return {
      root: {
        flex: "1 1 100%",
        minHeight: 0,
        display: "flex",
        flexDirection: "column"
      },
      container: {
        flex: "1 1 100%;",
        display: "flex",
        flexDirection: "column",
        overflowY: "auto"
      }
    };
  }

  render() {
    return (
      <Tabs
        style={this.styles.root}
        justify
        defaultActiveKey={this.state.tabs[0].eventKey}
      >
        {this.state.tabs.map(tab => (
          <Tab key={tab.id} eventKey={tab.eventKey} title={tab.title}>
            {tab.component}
          </Tab>
        ))}
      </Tabs>
    );
  }
}

export default Navbar;
